(1, '79f55d48-1494-48cd-8ded-f0185e981789', '2023-04-15 21:37:03', NULL, NULL, '9b7a3900-e942-42d4-a9e1-472fe06e266c', 'Exemple de publicité', 'Ne faite pas attention, c\'est juste un test pour les bannières publicitaire', '2023-04-15 12:00:00', '2023-04-27 12:00:00');
INSERT INTO `announce` (`id`, `status`, `user_created`, `date_created`, `user_updated`, `date_updated`, `price`, `author_firstname`, `author_lastname`, `author_phone`, `type`, `title`, `description`, `summary`, `author_discord`, `author_identity_card`, `complement`, `is_company`, `price_comment`) VALUES
(95, 'finished', '79f55d48-1494-48cd-8ded-f0185e981789', '2023-04-12 23:38:42', '79f55d48-1494-48cd-8ded-f0185e981789', '2023-04-13 17:37:58', 450000, 'Bruce', 'Ratieuville', '580-8467', 'clothing', 'Vente Sac à dos 36 Kg - Noirs', '<p>Prix : 450 000$ (n&eacute;gociable)</p>\n<p>Sac &agrave; dos 36 Kg noir.</p>\n<p>Mati&egrave;re : Textile, toile et cuir synth&eacute;tiques<br />Capacit&eacute; : 36 Kg</p>\n<p>&Eacute;tat : presque neuf, seconde main</p>\n<p>&nbsp;</p>', 'Vente d\'un sac à dos 36 Kg totalement noirs. Facile à porter et confortable, permet de transporter une grande quantité de soda.', 'bruce_ratieuville#0476', '95e5a7d2-1a17-41e3-b511-d732d85723e9', NULL, 0, 'TTC'),
(97, 'published', '79f55d48-1494-48cd-8ded-f0185e981789', '2023-04-13 11:00:44', '79f55d48-1494-48cd-8ded-f0185e981789', '2023-04-13 11:11:42', 20000, 'Francis', 'Pignon', '867-6482', 'vehicle', 'Vend Issi', '<p>Je dois &ecirc;tre le seul imb&eacute;cile qui a achet&eacute; cette voiture neuf &agrave; mes d&eacute;but. Franchement prenez une Issi sport si vous avez les moyens...</p>\n<p><strong>Customisation </strong>: Moteur niv 2 (faute de budget)<br /><strong>&Eacute;tat neuf</strong> : Neuf, j\'ai pas nettoyer l\'int&eacute;rieur, mais vu le prix vous n\'allez pas vous en plaindre...</p>\n<p><strong>Couleur</strong> : Noir Mat<br /><strong>Nacr&eacute;</strong> : Blanc (sur conseil regrettable du garagiste)<br />De plus je tiens &agrave; ajouter que les jantes ont &eacute;t&eacute; chang&eacute;.</p>\n<p>&nbsp;</p>', 'Je met en vente ma petite issi qui ne me sert plus à grand chose, peut-être qu\'elle pourra profiter à un nouveau en ville', NULL, 'a5baf656-9835-416c-b05f-66581ef025aa', NULL, 0, 'TTC'),
