(262, 293, 'vending', '2', '{\"id\":2,\"status\":\"published\",\"date_created\":\"2023-03-24T20:58:15.000Z\",\"date_updated\":\"2023-03-26T19:37:23.000Z\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"title\":\"Vente Fusil Militaire / Tec-9 / Micro Uzi\",\"description\":\"Vente Fusil Militaire 7.8 Millions / Tec-9 3.5 Millions / Micro Uzi 4 Millions\",\"details\":\"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus porttitor, lacus id sagittis ultricies, nunc quam hendrerit quam, eu blandit nunc elit in augue. Pellentesque eu augue in est sollicitudin pellentesque. Quisque venenatis elit sed odio congue, sit amet sagittis mi rhoncus. Phasellus convallis interdum nunc, ultrices fringilla justo molestie et. Aliquam sapien purus, pretium quis nunc at, congue tempus ex. Etiam tempor mi quis hendrerit posuere. Phasellus faucibus venenatis vestibulum. Aenean at erat at mauris blandit aliquam et vitae nisl. Nunc malesuada elit suscipit est volutpat, eget bibendum sem lacinia. Morbi lectus tellus, ullamcorper eu auctor quis, tincidunt non ex. Phasellus quis elit id metus vestibulum congue.</p>\\n<p>Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Aliquam nec velit a purus suscipit auctor. Suspendisse ac hendrerit sem, vel ultricies massa. Nam a mi efficitur ex fringilla consequat quis eget quam. Vivamus bibendum, elit at luctus blandit, erat leo consequat mi, quis sollicitudin sapien metus quis neque. Praesent porta urna ac elit commodo, ut ultrices nisl cursus. Nunc rutrum libero tempor nunc mollis commodo. Suspendisse potenti.</p>\",\"image_id\":\"28cb37b9-ab27-4f29-b525-557a63ad679f\",\"price\":100000,\"articles_id\":[2,3,4]}', '{\"price\":19000000,\"date_updated\":\"2023-03-26T19:37:23.631Z\"}', NULL),
