(1108, 1185, 'announce', '1', '{\"id\":1,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T19:56:11.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-11T23:10:43.000Z\",\"price\":9500000,\"author_firstname\":\"Francis\",\"author_lastname\":\"Pignon\",\"author_phone\":\"999-6630\",\"type\":\"propertie\",\"title\":\"Vente d\'appartement Vinewood\",\"description\":\"<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Beau manoir historique entour&eacute; de 10.000m2 de jardin<br />Capacit&eacute; 26x invit&eacute;s<br />Il y a 5 chambres + 3 sdb avec un grand salon de 100 m2 avec 6 lits + 3 canap&eacute;s-lits chambres + 4 canap&eacute;s-lits dans le salon + lit gonflable x2 adultes + immense chemin&eacute;e<br />Une grande Piscine 12x5<br />Un grand nombre de transats et de parasols pour se d&eacute;tendre autour de la piscine et dans l\'immense jardin.<br />Tables int&eacute;rieures et tables ext&eacute;rieures Capacit&eacute; jusqu\'&agrave; 26 personnes<br />Acc&egrave;s direct &agrave; la for&ecirc;t pour l\'&eacute;quitation et plus</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Le Manoir (400m2) est de pur style Normand &agrave; colombages avec 2 &eacute;tages, avec 5x Chambres Doubles dont 2 suites parentales (&gt;30m2) avec une salle &agrave; manger (100m2), 3x Grande Salle de Bain Priv&eacute;e, Barbecue &agrave; Charbon, et une chemin&eacute;e monumentale pour accueillir 26x personnes.<br /><br />Un parc de 1 hectare entoure le domaine du manoir avec un terrain pour les chevaux.<br /><br />A l\'&eacute;tage toutes les pi&egrave;ces sont en bois et les salles de bains des 2 suites parentales + 2 chambres parentales sont pratiques et confortables pour accueillir 10x personnes.<br />Rez-de-chauss&eacute;e, 1 chambre principale + 1 salle de bain s&eacute;par&eacute;e et espace commun (100m2) 3x lit queen convertible et 1x canap&eacute;-lit<br />Chaque lit avec draps et couette + Serviette de toilette et cintres.<br />Nous avons des draps suppl&eacute;mentaires &agrave; votre disposition sur demande.<br />Une piscine de 12x5m est &agrave; votre disposition avec eau chaude pour votre confort.<br />La cuisine comprend un lave-vaisselle, un four et un four micro-ondes.<br />1 barbecue est &agrave; votre disposition pr&egrave;s de la cuisine pour passer un incroyable d&eacute;jeuner ou d&icirc;ner entre amis.<br />Loisirs : Balan&ccedil;oire + ping-pong + b&eacute;b&eacute; + 4 v&eacute;los adultes, 1 v&eacute;lo enfant.<br />Une grande table en verre dans le salon peut accueillir 14 personnes avec sa table ronde de service pour 12 personnes soit 26x personnes au diner !<br />La nuit, la lumi&egrave;re de la piscine et la maison &eacute;clairent toutes ces lumi&egrave;res.<br /><br />Au dela de 16x personnes, chaque invitee devra s\'acquitter de frais de 55 E/jour par personne sur facture.<br />Vous pouvez prendre un petit-d&eacute;jeuner fran&ccedil;ais avec baguette, confiture locale, miel local et croissant pour 10 &euro; par personne.<br />Vous pourrez &eacute;galement profiter de la table d\'h&ocirc;tes sur r&eacute;servation.<br /><br />Le manoir est situ&eacute; &agrave; Beaumont &agrave; proximit&eacute; de la for&ecirc;t Roger, l\'un des plus grands domaines priv&eacute;s d\'Europe. Le sentier de randonn&eacute;e GR 224 passe le premier domaine avec des acc&egrave;s privil&eacute;gi&eacute;s pour partir en balade &agrave; cheval en for&ecirc;t. La Risle est &agrave; proximit&eacute; de la propri&eacute;t&eacute; ainsi que la Normandie, rivi&egrave;re de 1&egrave;re cat&eacute;gorie.<br /><br />Situ&eacute; &agrave; 15 minutes de la gare de Bernay (direction - Caen Paris), nous pouvons venir vous chercher &agrave; la gare pour 20&euro; (4 passagers) ou commander un petit van pour 7 passagers pour 40&euro;<br /><br />Acc&egrave;s &agrave; la piscine chauff&eacute;e, au terrain de tennis (sur demande Bernay), &agrave; la salle de jeux (table de ping pong ext&eacute;rieure, 4 v&eacute;los adultes, 2 v&eacute;los enfants, et jeux ext&eacute;rieurs...).<br />Avis important : Manoir est surveill&eacute; (EPS T&eacute;l&eacute;surveillance 24/24h) par vid&eacute;osurveillance et d&eacute;tecteur contre vol, intrusion, et inondation. Votre vie priv&eacute;e et votre s&eacute;curit&eacute; sont notre principale priorit&eacute;<br />D&eacute;tail pour Tennis de Bernay (15min) ou La Barre en Ouche (5min)</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Acc&egrave;s des voyageurs</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Tout le domaine et le manoir est a votre entiere disposition</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">La chemin&eacute;e monumentale peut &ecirc;tre allum&eacute;e sur demande par nos soins<br />L\'usage du foyer est r&eacute;serv&eacute; uniquement au bois disponible dans le domaine ext&eacute;rieur et il est interdit de l\'utiliser comme BBQ pour des raisons de s&eacute;curit&eacute;.<br />Le centre &eacute;questre est disponible sur demande (Co&ucirc;t sur demande) pour des balades &agrave; cheval entre amis et jeunes enfants ou occasions carri&egrave;re Contact (cf album) Vicent Hamlet (cf album) &agrave; Beaumesnil</span></div>\\n</div>\",\"summary\":\"Vente d\'un  Appartement à vinewood bien placé entre 350 St Avenue et l\'observatoire.\",\"images_list\":[1,2,3]}', '{\"title\":\"Vente d\'appartement Vinewood\",\"description\":\"<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Beau manoir historique entour&eacute; de 10.000m2 de jardin<br />Capacit&eacute; 26x invit&eacute;s<br />Il y a 5 chambres + 3 sdb avec un grand salon de 100 m2 avec 6 lits + 3 canap&eacute;s-lits chambres + 4 canap&eacute;s-lits dans le salon + lit gonflable x2 adultes + immense chemin&eacute;e<br />Une grande Piscine 12x5<br />Un grand nombre de transats et de parasols pour se d&eacute;tendre autour de la piscine et dans l\'immense jardin.<br />Tables int&eacute;rieures et tables ext&eacute;rieures Capacit&eacute; jusqu\'&agrave; 26 personnes<br />Acc&egrave;s direct &agrave; la for&ecirc;t pour l\'&eacute;quitation et plus</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Le Manoir (400m2) est de pur style Normand &agrave; colombages avec 2 &eacute;tages, avec 5x Chambres Doubles dont 2 suites parentales (&gt;30m2) avec une salle &agrave; manger (100m2), 3x Grande Salle de Bain Priv&eacute;e, Barbecue &agrave; Charbon, et une chemin&eacute;e monumentale pour accueillir 26x personnes.<br /><br />Un parc de 1 hectare entoure le domaine du manoir avec un terrain pour les chevaux.<br /><br />A l\'&eacute;tage toutes les pi&egrave;ces sont en bois et les salles de bains des 2 suites parentales + 2 chambres parentales sont pratiques et confortables pour accueillir 10x personnes.<br />Rez-de-chauss&eacute;e, 1 chambre principale + 1 salle de bain s&eacute;par&eacute;e et espace commun (100m2) 3x lit queen convertible et 1x canap&eacute;-lit<br />Chaque lit avec draps et couette + Serviette de toilette et cintres.<br />Nous avons des draps suppl&eacute;mentaires &agrave; votre disposition sur demande.<br />Une piscine de 12x5m est &agrave; votre disposition avec eau chaude pour votre confort.<br />La cuisine comprend un lave-vaisselle, un four et un four micro-ondes.<br />1 barbecue est &agrave; votre disposition pr&egrave;s de la cuisine pour passer un incroyable d&eacute;jeuner ou d&icirc;ner entre amis.<br />Loisirs : Balan&ccedil;oire + ping-pong + b&eacute;b&eacute; + 4 v&eacute;los adultes, 1 v&eacute;lo enfant.<br />Une grande table en verre dans le salon peut accueillir 14 personnes avec sa table ronde de service pour 12 personnes soit 26x personnes au diner !<br />La nuit, la lumi&egrave;re de la piscine et la maison &eacute;clairent toutes ces lumi&egrave;res.<br /><br />Au dela de 16x personnes, chaque invitee devra s\'acquitter de frais de 55 E/jour par personne sur facture.<br />Vous pouvez prendre un petit-d&eacute;jeuner fran&ccedil;ais avec baguette, confiture locale, miel local et croissant pour 10 &euro; par personne.<br />Vous pourrez &eacute;galement profiter de la table d\'h&ocirc;tes sur r&eacute;servation.<br /><br />Le manoir est situ&eacute; &agrave; Beaumont &agrave; proximit&eacute; de la for&ecirc;t Roger, l\'un des plus grands domaines priv&eacute;s d\'Europe. Le sentier de randonn&eacute;e GR 224 passe le premier domaine avec des acc&egrave;s privil&eacute;gi&eacute;s pour partir en balade &agrave; cheval en for&ecirc;t. La Risle est &agrave; proximit&eacute; de la propri&eacute;t&eacute; ainsi que la Normandie, rivi&egrave;re de 1&egrave;re cat&eacute;gorie.<br /><br />Situ&eacute; &agrave; 15 minutes de la gare de Bernay (direction - Caen Paris), nous pouvons venir vous chercher &agrave; la gare pour 20&euro; (4 passagers) ou commander un petit van pour 7 passagers pour 40&euro;<br /><br />Acc&egrave;s &agrave; la piscine chauff&eacute;e, au terrain de tennis (sur demande Bernay), &agrave; la salle de jeux (table de ping pong ext&eacute;rieure, 4 v&eacute;los adultes, 2 v&eacute;los enfants, et jeux ext&eacute;rieurs...).<br />Avis important : Manoir est surveill&eacute; (EPS T&eacute;l&eacute;surveillance 24/24h) par vid&eacute;osurveillance et d&eacute;tecteur contre vol, intrusion, et inondation. Votre vie priv&eacute;e et votre s&eacute;curit&eacute; sont notre principale priorit&eacute;<br />D&eacute;tail pour Tennis de Bernay (15min) ou La Barre en Ouche (5min)</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Acc&egrave;s des voyageurs</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Tout le domaine et le manoir est a votre entiere disposition</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">La chemin&eacute;e monumentale peut &ecirc;tre allum&eacute;e sur demande par nos soins<br />L\'usage du foyer est r&eacute;serv&eacute; uniquement au bois disponible dans le domaine ext&eacute;rieur et il est interdit de l\'utiliser comme BBQ pour des raisons de s&eacute;curit&eacute;.<br />Le centre &eacute;questre est disponible sur demande (Co&ucirc;t sur demande) pour des balades &agrave; cheval entre amis et jeunes enfants ou occasions carri&egrave;re Contact (cf album) Vicent Hamlet (cf album) &agrave; Beaumesnil</span></div>\\n</div>\",\"summary\":\"Vente d\'un  Appartement à vinewood bien placé entre 350 St Avenue et l\'observatoire.\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-11T23:10:43.127Z\"}', NULL);
