(1113, 1190, 'announce', '8', '{\"id\":8,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T20:55:24.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-11T23:29:26.000Z\",\"price\":150000,\"author_firstname\":\"Jonathan\",\"author_lastname\":\"Aselot\",\"author_phone\":\"650-3601\",\"type\":\"propertie\",\"title\":\"Logement entier : logement ? Chez Thierry\",\"description\":\"<div class=\\\"_68a6l8\\\">\\n<h2 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">&Agrave; propos de ce logement</h2>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Situ&eacute; en plein c&oelig;ur du parc naturel r&eacute;gional du Perche, dans un hameau typique, la maison de Marie est un gite enti&egrave;rement r&eacute;habilit&eacute; en 2019 dans le respect du b&acirc;ti percheron (tomettes anciennes, enduits &agrave; la chaux, poutres apparentes..).<br />Dot&eacute; de tout le confort n&eacute;cessaire, c\'est le lieu id&eacute;al pour votre s&eacute;jour &agrave; la campagne &agrave; moins de 2 heures de Paris.<br />Le calme, la nature et les produits locaux seront au rendez-vous.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Au rez-de-chauss&eacute;e, vous disposerez :<br />- d\'une grande cuisine / salle &agrave; manger enti&egrave;rement &eacute;quip&eacute;e (piano de cuisine - r&eacute;frig&eacute;rateur/cong&eacute;lateur - lave vaisselle - lave linge - cafeti&egrave;re &agrave; capsule ....) donnant sur le jardin;<br />- d\'un salon cosy disposant d\'un po&ecirc;le &agrave; bois neuf et ouvrant sur une terrasse ensoleill&eacute;e;<br />- d\'une salle d\'eau / wc avec douche &agrave; l\'italienne et double vasque;<br />- d\'une grande chambre &eacute;quip&eacute;e de deux lits pouvant &ecirc;tre utilis&eacute;s s&eacute;par&eacute;ment ou joints et d\'une armoire.<br />A l\'&eacute;tage, deux chambres doubles dont l\'une &eacute;quip&eacute;e d\'un lit \\\"Queen-size\\\" et l\'autre d\'un lit double.<br />L\'ext&eacute;rieur s\'ouvre sur un grand jardin partag&eacute;, une terrasse est am&eacute;nag&eacute;e aux beaux jours (table de jardin, BBQ, chaises longues).</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Afin de vous accueillir dans les meilleurs conditions nous privil&eacute;gions une arriv&eacute;e du vendredi fin de journ&eacute;e au dimanche. Pour toute autre arriv&eacute;e, n\'h&eacute;sitez pas &agrave; nous contacter. Le forfait m&eacute;nage comprend la mise &agrave; disposition et l\'entretien du linge. Les chiens sont les bienvenus mais nous sommes au regret de ne pas accueillir les chats en raison des allergies.</span></div>\\n</div>\",\"summary\":\"Situé en plein cœur du parc naturel régional du Perche, dans un hameau typique, la maison de Marie est un gite entièrement réhabilité en 2019 dans le respect du bâti percheron (tomettes anciennes, enduits à la chaux, poutres apparentes..).  Doté de tout le confort nécessaire, c\'est le lieu idéal pour votre séjour à la campagne à moins de 2 heures de Paris.  Le calme, la nature et les produits locaux seront au rendez-vous.\",\"images_list\":[14]}', '{\"title\":\"Logement entier : logement ⸱ Chez Thierry\",\"description\":\"<div class=\\\"_68a6l8\\\">\\n<h2 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">&Agrave; propos de ce logement</h2>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Situ&eacute; en plein c&oelig;ur du parc naturel r&eacute;gional du Perche, dans un hameau typique, la maison de Marie est un gite enti&egrave;rement r&eacute;habilit&eacute; en 2019 dans le respect du b&acirc;ti percheron (tomettes anciennes, enduits &agrave; la chaux, poutres apparentes..).<br />Dot&eacute; de tout le confort n&eacute;cessaire, c\'est le lieu id&eacute;al pour votre s&eacute;jour &agrave; la campagne &agrave; moins de 2 heures de Paris.<br />Le calme, la nature et les produits locaux seront au rendez-vous.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Au rez-de-chauss&eacute;e, vous disposerez :<br />- d\'une grande cuisine / salle &agrave; manger enti&egrave;rement &eacute;quip&eacute;e (piano de cuisine - r&eacute;frig&eacute;rateur/cong&eacute;lateur - lave vaisselle - lave linge - cafeti&egrave;re &agrave; capsule ....) donnant sur le jardin;<br />- d\'un salon cosy disposant d\'un po&ecirc;le &agrave; bois neuf et ouvrant sur une terrasse ensoleill&eacute;e;<br />- d\'une salle d\'eau / wc avec douche &agrave; l\'italienne et double vasque;<br />- d\'une grande chambre &eacute;quip&eacute;e de deux lits pouvant &ecirc;tre utilis&eacute;s s&eacute;par&eacute;ment ou joints et d\'une armoire.<br />A l\'&eacute;tage, deux chambres doubles dont l\'une &eacute;quip&eacute;e d\'un lit \\\"Queen-size\\\" et l\'autre d\'un lit double.<br />L\'ext&eacute;rieur s\'ouvre sur un grand jardin partag&eacute;, une terrasse est am&eacute;nag&eacute;e aux beaux jours (table de jardin, BBQ, chaises longues).</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Afin de vous accueillir dans les meilleurs conditions nous privil&eacute;gions une arriv&eacute;e du vendredi fin de journ&eacute;e au dimanche. Pour toute autre arriv&eacute;e, n\'h&eacute;sitez pas &agrave; nous contacter. Le forfait m&eacute;nage comprend la mise &agrave; disposition et l\'entretien du linge. Les chiens sont les bienvenus mais nous sommes au regret de ne pas accueillir les chats en raison des allergies.</span></div>\\n</div>\",\"summary\":\"Situé en plein cœur du parc naturel régional du Perche, dans un hameau typique, la maison de Marie est un gite entièrement réhabilité en 2019 dans le respect du bâti percheron (tomettes anciennes, enduits à la chaux, poutres apparentes..).  Doté de tout le confort nécessaire, c\'est le lieu idéal pour votre séjour à la campagne à moins de 2 heures de Paris.  Le calme, la nature et les produits locaux seront au rendez-vous.\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-11T23:29:26.485Z\"}', NULL),
