\\n<ul>\\n<li id=\\\"pollutionNorm\\\" class=\\\"Item_flexWrap__Rz2D2 Item_hasTooltip__vikT0\\\" data-tracking-click-id=\\\"normeEuro\\\"><span class=\\\"Text_Text_text Text_Text_subtitle2\\\">Norme euro :</span><span class=\\\"Item_content__Xyd3d\\\"><span class=\\\"Text_Text_text Text_Text_body1\\\">EURO6</span>&nbsp;</span></li>\\n<li id=\\\"critAir\\\" class=\\\"Item_flexWrap__Rz2D2 Item_hasTooltip__vikT0\\\" data-tracking-click-id=\\\"critair\\\"><span class=\\\"Text_Text_text Text_Text_subtitle2\\\">Crit\'Air :</span><span class=\\\"Item_content__Xyd3d\\\"><span class=\\\"Text_Text_text Text_Text_body1\\\">1</span>&nbsp;</span></li>\\n</ul>\\n</section>\\n</div>\",\"summary\":\"Vente d\'une Kuruma noir mat nacré bleu, un véhicule rare\",\"author_discord\":\"cacaouete#5325\",\"images_list\":[15,16,17,18,19,20]}', '{\"author_discord\":\"cacaouete#5325\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T13:18:32.105Z\"}', NULL),
(1167, 1244, 'announce', '10', '{\"id\":10,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T21:00:31.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T13:18:51.000Z\",\"price\":450000,\"author_firstname\":\"Henry\",\"author_lastname\":\"David\",\"author_phone\":\"452-5478\",\"type\":\"propertie\",\"title\":\"Logement entier : logement ? Los Santos\",\"description\":\"<div class=\\\"_68a6l8\\\">\\n<h2 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">&Agrave; propos de ce logement</h2>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Maison au calme au bout d\'une impasse bord&eacute;e par la for&ecirc;t. Elle dispose d\'un parking privatif, la cuisine est enti&egrave;rement &eacute;quip&eacute;e avec une baie vitr&eacute;e donnant sur la terrasse. Grande table dans la cuisine qui est ouverte sur le salon. Chambre parentale au rdc avec douche &agrave; l\'italienne, toilettes s&eacute;par&eacute;es, 2 salons ( un chemin&eacute;e et un t&eacute;l&eacute;), 2 chambres &agrave; l\'&eacute;tage avec un lit double et 2 lits simples. Chacune dispose de sa salle de bains + toilettes pour un maximum de confort. Jacuzzi et trampoline</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Entr&eacute;e avec pat&egrave;res, toilettes s&eacute;par&eacute;es, chambre au rez-de-chauss&eacute;e avec douche italienne, cuisine toute &eacute;quip&eacute;e, table de salle &agrave; manger dans la cuisine, salon avec grande chemin&eacute;e ( bois &agrave; disposition), petit barbecue Weber au charbon de bois, salon avec grande t&eacute;l&eacute; connect&eacute;e au mur, escalier en ch&ecirc;ne, &agrave; l\'&eacute;tage 2 chambres mansard&eacute;es: une avec lit double 160 cm avec salle de douche + toilettes, l\'autre avec 2 lits simples et salle de bains ( grande baignoire d\'1,80cm) + toilettes. Le jacuzzi fonctionne et est chauff&eacute; toute l\'ann&eacute;e. Lit b&eacute;b&eacute; et chaise haute, jeux et livres pour les enfants &agrave; disposition ( voir les photos), jeux de cartes, jeux de soci&eacute;t&eacute;s, quelques livres. jeux d\'ext&eacute;rieur pour enfants &agrave; disposition.<br />Les draps, les serviettes, les tapis de bains et torchons sont fournis ( voir les photos). Les produits de premi&egrave;re n&eacute;cessit&eacute; sont fournis, vous pouvez venir vous reposer sans d&eacute;valiser au pr&eacute;alable vos placards de cuisine:) : condiments, capsules de caf&eacute;, th&eacute;, serviettes de table en papier, papier toilettes, sacs poubelles 50l, gel douche et shampooing, bois pour la chemin&eacute;e et allume feu, produits vaisselle et lessive, produits m&eacute;nagers, savon pour les mains,... et pour toutes les recettes de g&acirc;teau improvis&eacute;s il y a du sucre, de la farine, de la levure,...<br />La chaudi&egrave;re est &agrave; granul&eacute;s, je laisse &agrave; disposition des sacs de granul&eacute;s, il y a un thermostat netatmo pour la mettre &agrave; bonne temp&eacute;rature.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Acc&egrave;s des voyageurs</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Tous les commerces sont accessibles en voiture.<br />Pour les courses, se rendre &agrave; Beuzeville:<br />- fromager: autour du fromage au 189 rue Constant Fouch&eacute;<br />- boucherie Ludovic Mezerais 136 rue de Constant Fouch&eacute;<br />- &eacute;picerie: Au d&eacute;lice de la table chez V&eacute;vette 80 rue Constant Fouch&eacute;: tr&egrave;s bon cidre, camembert, beaux fruits et l&eacute;gumes, cr&egrave;me et beurre fermiers<br />- poissonnerie: peut vous pr&eacute;parer vos plateaux de fruits de mer<br />- boulangerie, pharmacie, fleuriste sur la place<br /><br />- Le plus proche: &eacute;picerie avec de bonnes viennoiseries, tabac, caf&eacute; &agrave; Conteville, d&eacute;p&ocirc;t de pain &agrave; Boulleville ouvert 24/24h<br /><br />Supermarch&eacute;s:<br />- beuzeville: intermarch&eacute; ou carrefour market<br />- avant honfleur : E.Leclerc ( Av. Marcel Liabastre, 14600 Honfleur)<br />- LIDL avant Honfleur<br /><br />Autres poissonniers:<br />Honfleur: Jet&eacute;e de Transit 14600 Honfleur du jeudi au dimanche matin<br />Trouville: Nombreuses poissonneries ou vous pourrez d&eacute;guster un beau plateau de fruits de mer sur place avec verre de vin<br /><br />Autres commerces tr&egrave;s bons:<br />- la fromagerie d\'Annabelle: 11 Rue Hamelin, 14130 Pont-l\'&Eacute;v&ecirc;que<br />- boucherie Edouard &amp; Lucille : 8 Rue Hamelin, 14130 Pont-l\'&Eacute;v&ecirc;que<br />- &eacute;picerie italienne casa romeo : d&eacute;licieux!<br /><br />Restaurants:<br />- le restaurant du phare: en bas de la maison: une cuisine de qualit&eacute; avec des menus &agrave; 18 &euro;, 29&euro;, 42&euro; ainsi que leur carte avec divers choix de mets<br />- auberge de l\'&eacute;tampage: ambiance authentique, excellents plats du terroir et des plats r&eacute;gionaux vari&eacute;s : 82 Quartier de l\'&Eacute;glise, 27680 Marais-Vernier<br />- les vapeurs &agrave; Trouville : r&eacute;put&eacute; pour ses moules et poissons: 160 Bd Fernand Moureaux,14360 Trouville-sur-Mer: balade sur la plage apr&egrave;s le d&eacute;jeuner<br />- les cyclistes &agrave; Honfleur: tr&egrave;s bonnes moules et pizzas, ambiance sympathique pour un prix tr&egrave;s raisonnable<br />- Endroits chics: la ferme de Saint-Sim&eacute;on et les jardins de Copp&eacute;lia 478 route du Bois du Breuil - RD 62, 14600 Pennedepie<br /><br />Activit&eacute;s:<br />- Viking aventure: parc accrobranche + paintball :Bois de F&eacute;camp, 27500<br />Aizier<br />en profiter pour visiter vieux port qui est un joli village avec des chaumi&egrave;res en toit de chaume<br />- Visite de Quillebeuf-sur-Seine et de son centre historique<br />- Balade sur les quais de Seine &agrave; partir de Berville-sur-mer jusqu\'au Pont de Normandie ( balade possible en rollers, en trottinettes, en v&eacute;los : se garer au restaurant l\'entrepont)<br />- Petit train &agrave; Honfleur ( 45 min de balade &agrave; travers la ville et sur les hauteurs) et grande roue ouverts d\'avril &agrave; octobre<br />- Plage sauvage de Pennedepie y aller de pr&eacute;f&eacute;rence &agrave; mar&eacute;e basse)<br />- Par beau temps: magnifique plage de Houlgate ( club Mickey) et ses nombreux restaurants dans la ville, tr&egrave;s joli minigolf<br />- Phare de la roque accessible &agrave; pied depuis la maison pour admirer un beau panorama, nombreuses randonn&eacute;es avec visite des vaches depuis la maison<br />- Base de pleine nature de Val de Risle: Canoe Kayak, paddle, course d\'orientation<br />- Club Nautique Risle-Seine de Toutainville: d&eacute;couvrir et pratiquer les sports nautiques dans une ambiance familiale et amicale sur un lac de 35 hectare: Voile, planche &agrave; voile, cano&eacute; et Paddle et ski nautique<br />- Golf 9 trous et practice ( pr&ecirc;t de clubs) : 19 Rte des &Eacute;tangs, 27500 Toutainville<br />- Centre &eacute;questre du Val loyer: La Mare, 27210 Saint-Sulpice-de-Grimbouville ( stage propos&eacute;s pendant les vacances scolaires)<br />- Thalasso Deauville by Algotherm: 3 Rue Sem, 14800 Deauville<br />- Naturospace &agrave; Honfleur : papillons et oiseaux tropicaux en libert&eacute;<br />- Minigolf &agrave; Honfleur coll&eacute; au naturospace<br />- Pal&eacute;ospace ( mus&eacute;e sur les dinosaures: 5 Avenue Jean Moulin &bull; 14640 Villers sur mer)<br />- La villersoise ( en face du Pal&eacute;ospace) : Location de v&eacute;los, v&eacute;los &eacute;lectriques, rosalies et autres cycles : tr&egrave;s sympa!<br />- Location de v&eacute;los et v&eacute;los &eacute;lectriques &agrave; Beuzeville. Ne pas h&eacute;siter &agrave; s\'y prendre en avance surtout l\'&eacute;t&eacute;. Livraison possible &agrave; la maison.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">- Grand jardin de 7 000 m&sup2; avec pr&eacute; ( le jardin est tondu tous les mois ou 15 jours par un jardinier, je vous pr&eacute;vins s\'il doit passer pendant votre s&eacute;jour)<br />- Bien s\'essuyer les pieds en sortant du jacuzzi avant de monter l\'escalier<br />- Attention &agrave; la table basse du salon, le plateau n\'est pas reli&eacute; &agrave; la base<br />- Friteuse, appareil &agrave; raclette, cafeti&egrave;re nespresso et dosettes, barbecue, bouilloire, th&eacute;i&egrave;re &agrave; disposition<br />- Jeux de plage et d\'int&eacute;rieur disponibles</span></div>\\n</div>\",\"summary\":\"Maison au calme au bout d\'une impasse bordée par la forêt. Elle dispose d\'un parking privatif, la cuisine est entièrement équipée avec une baie vitrée donnant sur la terrasse. Grande table dans la cuisine qui est ouverte sur le salon. Chambre parentale au rdc avec douche à l\'italienne, toilettes séparées, 2 salons ( un cheminée et un télé), 2 chambres à l\'étage avec un lit double et 2 lits simples. Chacune dispose de sa salle de bains + toilettes pour un maximum de confort. Jacuzzi et trampoline\",\"author_discord\":\"notf#5236\",\"images_list\":[21,22,23,24]}', '{\"author_discord\":\"notf#5236\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T13:18:51.560Z\"}', NULL),
