(1199, 1276, 'announce', '12', '{\"id\":12,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T21:02:30.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:27.000Z\",\"price\":450000,\"author_firstname\":\"Osman\",\"author_lastname\":\"Kitup\",\"author_phone\":\"654-5200\",\"type\":\"propertie\",\"title\":\"Vente appartement Paleto\",\"description\":\"<div class=\\\"_68a6l8\\\">\\n<h2 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">&Agrave; propos de ce logement</h2>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Studio privatif &eacute;quip&eacute;, fonctionnel, &agrave; la campagne.<br />Dans un joli cadre.<br />Pouvant accueillir 4 personnes.<br /><br />Situ&eacute; dans le nord de l\'Indre et Loire, proche du d&eacute;partement 72 et 49.<br /><br />Le logement comprend sa propre entr&eacute;e, sur notre terrain.<br />Vous serez donc parfaitement isol&eacute;s de notre lieu de vie et pourrez vous sentir comme chez vous.<br /><br />Vous serez amen&eacute; &agrave; croiser un chat et un chien dans le jardin.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">- Un lit 140x190 + un lit mezzanine 140x190 au dessus (plut&ocirc;t pour les enfants).<br />- Une Kitchenette &eacute;quip&eacute;: Frigo avec mini cong&eacute;lateur, plaque induction 2 foyers, Senseo, bouilloire, grille-pain, ustensiles, torchons, sel/poivre et huile...<br />- Une salle de bain avec baignoire et wc.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Acc&egrave;s des voyageurs</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Vous pourrez vous stationner librement sur notre parking priv&eacute;, juste en face de notre maison.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Autres remarques</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">A pieds ou en voiture, vous pourrez aller boire un verre et / ou visiter l\'Abbaye de la clart&eacute; dieu, situ&eacute;e &agrave; 1km et demi de la maison.<br />Une piscine exterieure est ouverte dans la commune tous les jours en Juillet/Ao&ucirc;t.<br /><br />Activit&eacute;s aux alentours :<br />- 1min de l\'Abbaye de Clart&eacute; Dieu<br />- 5min du domaine de la Fougeraie<br />- 30min de la base de loisirs de Hommes<br />- 35min du centre de Tours<br />- 45min du Zoo de la Fl&egrave;che<br />- 1h du Zoo de Dou&eacute; la fontaine<br />- 1h du circuit du Mans<br />- 1h du grand Aquarium de Touraine<br />- 1h10 de Terra Botanica<br />- 1h30 du Zoo de Beauval<br />- 2h du Futurocope</span></div>\\n</div>\",\"summary\":\"Studio privatif équipé, fonctionnel, à la campagne. Dans un joli cadre. Pouvant accueillir 4 personnes.  Situé dans le nord de l\'Indre et Loire, proche du département 72 et 49.\",\"author_discord\":null,\"author_identity_card\":\"27795104-d203-485a-9198-65cb5a1acf6e\",\"images_list\":[31,32,33,34,35,36]}', '{\"author_identity_card\":\"27795104-d203-485a-9198-65cb5a1acf6e\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:27.459Z\"}', NULL),
(1200, 1277, 'announce', '13', '{\"id\":13,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T21:03:14.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:34.000Z\",\"price\":360745,\"author_firstname\":\"Jeanne\",\"author_lastname\":\"Perret\",\"author_phone\":\"254-4587\",\"type\":\"vehicle\",\"title\":\"Vente Banshee 900R\",\"description\":\"<ul class=\\\"EquipmentOptionsInformation_column__rQp-a \\\">\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Ext&eacute;rieur et Chassis</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">P&eacute;dalier aluminium</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Seuils de portes AV en Inox</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Coques de r&eacute;troviseurs ext&eacute;rieurs Noir Brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Canule d\'&eacute;chappement chrom&eacute;e (droite)</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">L&eacute;cheurs de vitres lat&eacute;rales Noir Brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Passages de roue Noir brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Planche de bord slush surpiqu&eacute;e et panneaux de portes AV avec d&eacute;cors aspect carbone et &eacute;clairage polyambiant 8 couleurs</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Bandeau entre feux AR noir brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Calandre haut de gamme avec grille sup&eacute;rieure avec marquage Dark Chrome et enjoliveur sup&eacute;rieur Noir Brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Jupes de pare-chocs AR inf&eacute;rieure et sup&eacute;rieure Noir brillant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Enjoliveurs de pied milieu brillant avec s&eacute;rigraphies AV</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Aide parking</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Frein de parking automatique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Jantes alu</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Jantes alu 17\\\"</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs d&eacute;givrants</div>\\n</li>\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Int&eacute;rieur</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Avertisseur de temps de conduite</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Verrouillage automatique de tous les ouvrants en roulant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Habitacle et ciel de pavillon noir</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Si&egrave;ge passager AV &agrave; r&eacute;glage manuel en hauteur</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Fixations suivant norme ISOFIX sur si&egrave;ge passager AV avec &eacute;tiquettes de localisation</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">4 poign&eacute;es de maintien (2 &agrave; l\'AV et 2 &agrave; l\'AR)</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Si&egrave;ge conducteur avec r&eacute;glage manuel en hauteur</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">6 haut-parleurs (2 tweeters et 2 woofers &agrave; l\'AV et 2 larges bandes &agrave; l\'AR)</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Syst&egrave;me de surveillance d\'angle mort</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Console haute avec accoudoir int&eacute;gr&eacute;</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">2 prises USB (Recharge type A) sur console basse pour passagers AR</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Pare-brise teint&eacute; acoustique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs ext&eacute;rieurs d&eacute;givrants avec r&eacute;glage et rabattement &eacute;lectriques</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">D&eacute;marrage mains libres avec 2 t&eacute;l&eacute;commandes 3 boutons</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Vitres lat&eacute;rales AR et lunette AR chauffante temporis&eacute;e surteint&eacute;es</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Fonction \\\"Mirror Screen\\\" (Apple CarPlay / Android Auto )</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Cam&eacute;ra de recul</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Climatisation automatique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Direction assist&eacute;e</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Prise audio USB</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Vitres ar. surteint&eacute;es</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Vitres &eacute;lectriques</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Volant r&eacute;glable en hauteur et profondeur</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">&Eacute;cran tactile</div>\\n</li>\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Confort</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Bluetooth</div>\\n</li>\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">S&eacute;curit&eacute;</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;gulateur / Limiteur de vitesse</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Commutation automatique des feux de route / feux de croisement</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Appuis-t&ecirc;te r&eacute;glables en hauteur AV et AR (x3)</div>\\n</li>\\n</ul>\\n<ul class=\\\"EquipmentOptionsInformation_column__rQp-a \\\">\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW EquipmentOptionsInformation_mobileHidden__L9Pq3\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">S&eacute;curit&eacute;</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Reconnaissance &eacute;tendue des panneaux de signalisation et pr&eacute;conisation de vitesse</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Feux diurnes &agrave; LED sous projecteurs</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Projecteurs \\\"Peugeot Full LED Technology\\\" avec signature 3 griffes</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">ABS</div>\\n</li>\\n<li>&nbsp;</li>\\n</ul>\",\"summary\":\"Vente d\'une Bravado Banshee 900R full custom\",\"author_discord\":null,\"author_identity_card\":\"3d50ff86-48d5-4b2c-a0a7-9fb373637f61\",\"images_list\":[37,38,39]}', '{\"author_identity_card\":\"3d50ff86-48d5-4b2c-a0a7-9fb373637f61\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:34.679Z\"}', NULL),
(1201, 1278, 'announce', '15', '{\"id\":15,\"status\":\"published\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T21:05:03.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:46.000Z\",\"price\":36200,\"author_firstname\":\"Justin\",\"author_lastname\":\"Bridou\",\"author_phone\":\"475-250\",\"type\":\"propertie\",\"title\":\"Vente d\'une maison à Paleto Bay\",\"description\":\"<div class=\\\"_68a6l8\\\">\\n<h2 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">&Agrave; propos de ce logement</h2>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div><span class=\\\"ll4r2nl dir dir-ltr\\\">Venez profiter d\'un appartement enti&egrave;rement r&eacute;nov&eacute;, au centre-ville d\'Auxerre.<br />Au 4e et dernier &eacute;tage avec ascenseur<br />Id&eacute;alement situ&eacute; &agrave; c&ocirc;t&eacute; du parc Paul Bert, proche de toutes les commodit&eacute;s, vous pourrez visiter le centre historique de la ville &agrave; pied.<br />Facilement accessible, nombreuses places de parking gratuites au pied de la r&eacute;sidence. Gare SNCF &agrave; 15 min &agrave; pied.<br />Chablis et son vignoble &agrave; quelques kilom&egrave;tres.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Le logement</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">L\'appartement est id&eacute;al pour venir vous ressourcer en amoureux, entre amis ou en famille.<br /><br />Voyageurs professionnels, vous disposerez d\'un bureau et d\'une connexion Wifi tr&egrave;s haut d&eacute;bit (Fibre).<br /><br />Vous pourrez cuisiner de bons petits plats dans la cuisine enti&egrave;rement &eacute;quip&eacute;e ( four traditionnel, four &agrave; micro-ondes, lave-vaisselle, bouilloire, grille-pain, cafeti&egrave;re Nespresso, machine &agrave; laver).<br /><br />Le caf&eacute; et le th&eacute; vous sont offerts.<br /><br />Dans le salon, TV, lecteur DVD, enceinte Bluetooth, livres, DVD et jeux de soci&eacute;t&eacute; pour &eacute;gayer vos soir&eacute;es.<br /><br />Le lit sera fait &agrave; votre arriv&eacute;e et vous disposerez de linge de toilette.<br /><br />Dans le salon, vous profiterez d\'un canap&eacute; convertible de qualit&eacute;, &agrave; ouverture facile.<br /><br />L\'appartement est situ&eacute; au 4e et dernier &eacute;tage avec ascenseur. Acc&egrave;s s&eacute;curis&eacute;.<br /><br />Vous pourrez garer votre voiture sur l\'une place des nombreuses places de parking gratuites devant la r&eacute;sidence et visiter la ville &agrave; pied.</span></div>\\n</div>\\n<div class=\\\"_178zopn\\\">\\n<div>\\n<div class=\\\"_pgfqnw\\\">\\n<h3 class=\\\"hghzvl1 dir dir-ltr\\\" tabindex=\\\"-1\\\">Acc&egrave;s des voyageurs</h3>\\n</div>\\n<span class=\\\"ll4r2nl dir dir-ltr\\\">Vous aurez acc&egrave;s &agrave; la totalit&eacute; de l\'appartement.</span></div>\\n</div>\",\"summary\":\"Vente d\'un maison en bord de mer juste à coté du commissariat de la BCSO et de plage\",\"author_discord\":null,\"author_identity_card\":\"3d50ff86-48d5-4b2c-a0a7-9fb373637f61\",\"images_list\":[46,47,48,49,50]}', '{\"author_identity_card\":\"3d50ff86-48d5-4b2c-a0a7-9fb373637f61\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T15:11:46.163Z\"}', NULL),
