(1204, 1281, 'announce', '2', '{\"id\":2,\"status\":\"cancelled\",\"user_created\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_created\":\"2023-04-11T20:46:40.000Z\",\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T16:52:45.000Z\",\"price\":300000,\"author_firstname\":\"David\",\"author_lastname\":\"Pokora\",\"author_phone\":\"652-6985\",\"type\":\"vehicle\",\"title\":\"Vente d\'un Kamacho Blanc\",\"description\":\"<ul class=\\\"EquipmentOptionsInformation_column__rQp-a \\\">\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Ext&eacute;rieur et Chassis</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs ext&eacute;rieurs r&eacute;glage &eacute;lectrique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Phares &agrave; allumage automatique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs ext&eacute;rieurs chauffants</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Ampoules de phares halog&egrave;nes</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Freins r&eacute;g&eacute;n&eacute;rateurs</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Feux arri&egrave;res &agrave; LED</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs rabattables &eacute;lectriquement</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Antibrouillards avant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">2 roues motrices</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs &eacute;lectriques</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseurs rabattables</div>\\n</li>\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW undefined\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Int&eacute;rieur</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Volant cuir</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Syst&egrave;me audio &eacute;cran tactile</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Ordinateur de bord</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Air conditionn&eacute; auto</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Accoudoir central avant</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Syst&egrave;me de navigation info trafic</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Limiteur de vitesse</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;troviseur jour/nuit</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Volant multi-fonction</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Bluetooth inclut musique en streaming, connexion t&eacute;l&eacute;phone</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Bluetooth</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Reconnaissance vocale</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">6 haut-parleurs</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;gulateur de vitesse</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">R&eacute;glage du volant en hauteur, en profondeur</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Taille &eacute;cran multi-fonctions 7 pouces</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Allume cigare</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Banquette 1/3 - 2/3</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Boite automatique</div>\\n</li>\\n</ul>\\n<ul class=\\\"EquipmentOptionsInformation_column__rQp-a \\\">\\n<li class=\\\"EquipmentOptionsInformation_category__UCMeW EquipmentOptionsInformation_mobileHidden__L9Pq3\\\">\\n<h3 class=\\\"Text_Text_text Text_Text_subtitle1\\\">Int&eacute;rieur</h3>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Boite s&eacute;quentielle</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Climatisation</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Configuration 5PL</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Direction assist&eacute;e</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Fermeture &eacute;lectrique</div>\\n</li>\\n<li>\\n<div class=\\\"Text_Text_text Text_Text_body1\\\">Kit t&eacute;l&eacute;phone main libre</div>\\n</li>\\n</ul>\",\"summary\":\"Vehicule en bonne état, peinture neuf, déjà nettoyé vendu avec les accessoires\",\"author_discord\":\"hyop#3502\",\"author_identity_card\":\"3d50ff86-48d5-4b2c-a0a7-9fb373637f61\",\"images_list\":[4,5,6,7,61,62]}', '{\"user_updated\":\"79f55d48-1494-48cd-8ded-f0185e981789\",\"date_updated\":\"2023-04-12T16:52:45.824Z\"}', NULL),
